<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Elisa & Arden â€” Save the Date</title>
  <link href="https://fonts.googleapis.com/css2?family=Cormorant+Garamond:ital,wght@0,300;0,400;0,500;0,600;1,300;1,400;1,500&family=Great+Vibes&family=Jost:wght@200;300;400;500&display=swap" rel="stylesheet" />
  <style>
    *, *::before, *::after { box-sizing: border-box; margin: 0; padding: 0; }

    :root {
      --brown: #c8967a;
      --light-brown: #b07858;
      --black: #1e1e1e;
    }

    html, body {
      min-height: 100%;
    }

    body {
      background: transparent;
      display: flex;
      align-items: flex-start;
      justify-content: center;
      min-height: 100vh;
      font-family: 'Jost', sans-serif;
      overflow-y: auto;
    }

    /* MOBILE BANNER - desktop only */
    .mobile-banner {
      display: none;
    }
    @media (min-width: 768px) {
      .mobile-banner {
        display: block;
        position: fixed;
        top: 0;
        left: 0;
        right: 0;
        z-index: 999;
        background: rgba(200, 150, 122, 0.15);
        backdrop-filter: blur(6px);
        -webkit-backdrop-filter: blur(6px);
        text-align: center;
        padding: 1.1rem 1rem;
        font-family: 'Jost', sans-serif;
        font-size: 0.8rem;
        font-weight: 400;
        letter-spacing: 0.2em;
        text-transform: uppercase;
        color: var(--light-brown);
        border-bottom: 1px solid rgba(200, 150, 122, 0.2);
      }
    }


    @media (min-width: 768px) {
      .mobile-banner {
        padding: 1.1rem 1rem;
        font-size: 0.8rem;
      }
      html, body {
        height: 100%;
        overflow: hidden;
      }
      body {
        align-items: flex-start;
        overflow: hidden;
      }
      .card {
        min-height: unset !important;
        height: calc(100vh - 52px) !important;
        justify-content: center !important;
        padding: 2vh 4rem !important;
        margin-top: 52px !important;
      }
      .card * {
        flex-shrink: 1;
      }
      .std-save, .std-date {
        font-size: clamp(2rem, 8vw, 8rem) !important;
      }
      .std-the {
        font-size: clamp(1.4rem, 5vw, 4.5rem) !important;
      }
    }

    /* ALL CONTENT ENTERS AS ONE FLOATING OBJECT */
    .card {
      text-align: center;
      padding: 0 4rem 8rem;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: flex-start;
      min-height: 100vh;
      width: 100%;
      max-width: 680px;
      background: transparent;
      animation: floatIn 1.8s cubic-bezier(0.22, 1, 0.36, 1) forwards;
      opacity: 0;
    }

    @keyframes floatIn {
      0%   { opacity: 0; transform: translateY(32px); }
      100% { opacity: 1; transform: translateY(0); }
    }

    /* SAVE THE DATE */
    .std-block { line-height: 1; margin-bottom: 3rem; }

    .std-save {
      display: block;
      font-family: 'Cormorant Garamond', serif;
      font-weight: 300;
      font-size: clamp(3.5rem, 13vw, 11rem);
      letter-spacing: 0.12em;
      color: var(--brown);
      line-height: 0.95;
    }

    .std-the {
      display: block;
      font-family: 'Great Vibes', cursive;
      font-size: clamp(2.2rem, 7vw, 6rem);
      color: var(--brown);
      line-height: 0.8;
      position: relative;
      right: 2%;
      margin-top: 0.55em;
      margin-bottom: 0.55em;
    }

    .std-date {
      display: block;
      font-family: 'Cormorant Garamond', serif;
      font-weight: 300;
      font-size: clamp(3.5rem, 13vw, 11rem);
      letter-spacing: 0.12em;
      color: var(--brown);
      line-height: 0.95;
    }

    .subtitle {
      font-family: 'Cormorant Garamond', serif;
      font-style: italic;
      font-weight: 500;
      font-size: clamp(1rem, 2.4vw, 1.5rem);
      color: var(--light-brown);
      letter-spacing: 0.06em;
      margin-bottom: 3rem;
    }

    .names {
      font-family: 'Cormorant Garamond', serif;
      font-weight: 600;
      font-size: clamp(1.6rem, 5.2vw, 3.6rem);
      letter-spacing: 0.2em;
      text-transform: uppercase;
      color: var(--black);
      margin-bottom: 1rem;
    }

    .date-line {
      font-family: 'Jost', sans-serif;
      font-weight: 400;
      font-size: clamp(1rem, 2.6vw, 1.4rem);
      letter-spacing: 0.15em;
      text-transform: uppercase;
      color: var(--black);
      margin-bottom: 1rem;
    }

    .location {
      font-family: 'Cormorant Garamond', serif;
      font-style: italic;
      font-weight: 500;
      font-size: clamp(1rem, 2.4vw, 1.5rem);
      color: var(--light-brown);
      letter-spacing: 0.06em;
      margin-bottom: 0;
    }

    .invitation {
      font-family: 'Cormorant Garamond', serif;
      font-style: italic;
      font-weight: 500;
      font-size: clamp(1rem, 2.4vw, 1.5rem);
      color: var(--light-brown);
      letter-spacing: 0.06em;
      margin-top: 5.5rem;
    }

    .flower-wrap {
      margin-top: 0.75rem;
    }

    .flower-wrap img {
      width: 42%;
      max-width: 168px;
      display: block;
      margin: 0 auto;
    }

    @media (max-width: 480px) {
      .card { padding: 0 3rem 6rem; }
    }
  </style>
</head>
